import './App.css';
import React from "react";
import Search from './search';
import pic from './scale.png'


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function About() {
  return <h2>About</h2>;
}

function App() {
  return (

    <div className="App">

      <header className="App-header">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about.jsx">About</Link>
            </li>
            </ul>
            </nav>
      <Search /> 
        <img src={pic} className="App-logo" alt="logo" /> 
      </header>
    </div>

  );
}

export default App;


